class Solution {

    /**
     * @param Integer[] $nums
     * @param Integer $limit
     * @return Integer[]
     */
    function lexicographicallySmallestArray($nums, $limit) {
        $n = count($nums);
        for ($i = 0; $i < $n - 1; ++$i) {
            $minIndex = $i;
            for ($j = $i + 1; $j < $n; ++$j) {
                if ($nums[$j] < $nums[$minIndex] && abs($nums[$j] - $nums[$i]) <= $limit) {
                    $minIndex = $j;
                }
            }
            if ($minIndex != $i) {
                $temp = $nums[$i];
                $nums[$i] = $nums[$minIndex];
                $nums[$minIndex] = $temp;
            }
        }
        return $nums;
    }
}
